import React from 'react';

import {
  Text,
  View,
  StyleSheet,
  Image,
  ScrollView,
  TextInput,
} from 'react-native';

const Estilos = StyleSheet.create({
  titulo: { fontWeight: 'bold', fontSize: '20pt' },
});

const App = () => {
  return (
    <ScrollView>
      <Text style={Estilos.titulo}>Sistema Solar</Text>
    </ScrollView>
  );
};

export default App;
